--
-- Table structure for table `user_events`
--

DROP TABLE IF EXISTS `user_events`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `user_events` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned DEFAULT NULL,
  `session_id` varchar(255) NOT NULL,
  `event_type` enum('page_view','product_view','add_to_cart','remove_from_cart','checkout_start','checkout_complete','purchase','login','register','logout','search','filter','wishlist_add') NOT NULL,
  `event_category` varchar(255) NOT NULL DEFAULT 'general',
  `event_data` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`event_data`)),
  `ip_address` varchar(45) DEFAULT NULL,
  `user_agent` text DEFAULT NULL,
  `referrer` varchar(255) DEFAULT NULL,
  `url` varchar(255) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `user_events_user_id_created_at_index` (`user_id`,`created_at`),
  KEY `user_events_event_type_created_at_index` (`event_type`,`created_at`),
  KEY `user_events_event_category_created_at_index` (`event_category`,`created_at`),
  KEY `user_events_session_id_index` (`session_id`),
  KEY `user_events_created_at_index` (`created_at`),
